import React from 'react';

import { Grid, Image } from 'semantic-ui-react'

import Footer from '../Footer';

import Flash from "react-reveal/Flash";

import "../css/Services.css";
import '../../App.css';


const Services = () => {
  return (
  	<>
  		<Head />
  		<SectionOne />
  		<SectionTwo />
  		<Footer />
  	</>
  );
}

const popover = (
  <Popover id="popover-basic">
    <Popover.Title as="h3">No FEAR</Popover.Title>
    <Popover.Content>
      We accept any challenge! Let us know what you need, and watch it get done!
    </Popover.Content>
  </Popover>
);

const Head = () => {
	return (
		<>
			<div className="contentContainer">
				<Jumbotron>
	  				<h1>OUR SERVICES</h1>
				    <p>
				    	We handle each project with great care and treat customer with the time and attention theu deserve. If the service you requested in not listed on this page, you can <span className="flashCont"><Flash><OverlayTrigger trigger="hover" placement="right" overlay={popover}><span className="contactLink">contact</span></OverlayTrigger></Flash></span> us to maek ararngements.
				    </p>

	  				<p>
	    				<Button variant="primary">Make it Happen</Button>
	  				</p>
				</Jumbotron>
			</div>
		</>
	)
}

const SectionOne = () => {
	return (
		<div className="service1">
			<Grid columns={2} divided>
				<Grid.Row>
					<Grid.Column>
						<Image src='https://react.semantic-ui.com/images/wireframe/media-paragraph.png' />
					</Grid.Column>
					<Grid.Column>
						<Image src='https://react.semantic-ui.com/images/wireframe/media-paragraph.png' />
					</Grid.Column>
				</Grid.Row>

				<Grid.Row>
				<Grid.Column>
				<Image src='https://react.semantic-ui.com/images/wireframe/media-paragraph.png' />
				</Grid.Column>
				<Grid.Column>
				<Image src='https://react.semantic-ui.com/images/wireframe/media-paragraph.png' />
				</Grid.Column>
				</Grid.Row>
			</Grid>
		</div>
	)
}

const SectionTwo = () => {
	return (
		<div className="service2">

		</div>
	)
}

export default Services;
